actions/hockey/.body:
hockey$ launch hockey
The hockey action will deploy your Cordova app to Hockey. Hockey supports both iOS and Android app distribution, so this action can upload either one, or both, based on which platforms you have added to your Meteor project.SetupFirst, make sure you have added the keys describe in the build action.Make sure you have created an application on Hockey corresponding to the type(s) of application(s) you want to upload. If you will be uploading both iOS and Android apps, you will need two separate apps on Hockey.iOSGenerate an API key for your iOS app on Hockey, and then add it to your launch.json.{
  "IOS_HOCKEY_TOKEN": "tokenhere"
}
AndroidGenerate an API key for your Android app on Hockey. You will also need the id of your application on Hockey for Android. Then, add it to your launch.json.{
  "ANDROID_HOCKEY_TOKEN": "tokenhere",
  "ANDROID_HOCKEY_ID": "idhere"
}
Crosswalk: If you use the Crosswalk webview, two different builds of your app are generated. Both of these will be uploaded to Hockey with different build numbers.

actions/playstore/.body:
playstore$ launch playstore
The playstore action will compile your Cordova build for Android, sign the APK file, and upload it to the Google Play Store. Currently, it uploads to the alpha channel, but that can be changed.SetupYou will need to have created an application on the Google Play Store.You will need to generate an auth file to allow uploading. To do this, navigate to Settings -> API Access in your Google Play account, then create a service account. When asked, generate a JSON file for auth, and download it. Provide the path to this file in your launch.json.{
  "PLAY_AUTH_FILE": ""
}
Crosswalk: If you use the Crosswalk webview, two different builds of your app are generated. Both of these will be uploaded to Google Play with different build numbers.
